results.description:
Esta ferramenta é muito útil se você precisa para fazer checagem de som! Na verdade Sound Check é projetado para gerar um som com diferentes frequências, de muito baixo a muito alto. Com esta utilidade você pode facilmente controlar a qualidade do som dos fones ou apenas ter um pouco de diversão!

As principais características de Sound Check:
- Uma vasta gama de frequências disponíveis;
- 4 tipos de ondas a escolher: sinusoidal, dente de serra, triângulo, e plana;
- Gerador de Tom sempre à mão.

Esta aplicação pode ser um instrumento de controle para fones de ouvido e muito mais! Teste a qualidade de som, experimentando com sons, ondas sonoras, efeitos sonoros e muito mais!
